import React from 'react';
import '../styles/About.css';  // Import About styles

const About = () => {
    return (
        <section id="about" className="about">
            <h2>About Me</h2>
            <p>Hi, I'm Pruthvi Gadhiya, a Computer Software student with a passion for technology and innovation. My skills include working with programming languages such as C, Java, SQL, and MySQL. I thrive on solving problems and exploring the latest in technology. Currently, I'm looking for opportunities to apply my knowledge in impactful projects and develop professionally.</p>
        </section>
    );
}

export default About;
